import React from 'react';
import YouTube from 'react-youtube';

const YouTubeEmbed = (props) => {
  const opts = {
    height: '390',
    width: '640',
    playerVars: { // https://developers.google.com/youtube/player_parameters
      autoplay: 1
    }
  }

  console.log({props});
  return (
    <YouTube
      videoId={`${props}`}
      opts={opts}
    />
  );
}












